<template>
	<view class="container">
		<view class="qrcode flex_center">
			<view class="fz-24 flex_center">扫描下方二维码完成支付</view>
			<image :src="codeUrl" mode="aspectFit"></image>
		</view>
		<view class="logo flex_center">
			<image src="../../static/images/business/logo.png" mode="aspectFit"></image>
		</view>
		<view class="flex_center btn fz-16" @click="saveImg">保存至相册</view>
	</view>
</template>

<script>
	export default{
		data() {
			return {
				codeUrl:'',
			}
		},
		methods:{
			saveImg(){
				uni.getImageInfo({
					src:this.codeUrl,
					success: (res) => {
						console.log(res)
						uni.saveImageToPhotosAlbum({
							filePath:res.path,
							success: (res) => {
								console.log(res)
							}
						})
					},
					fail: (err) => {
						console.log(err)
						uni.showToast({
							title:err.message,
							icon:'none'
						})
					}
				})
			}
		},
		onLoad:function(query){
			this.codeUrl = query.url.replace('http','https');
		}
	}
</script>

